import React from 'react'

function HappyBirthdayTheme() {

  return (
    <div className='w-full h-screen flex flex-column justify-center'>
      <div className='w-full h-screen flex flex-row justify-center'>
        <video src='/videos/WhatsApp Video 2025-04-18 at 5.17.48 PM.mp4' className='w-7/12 h-96' autoPlay={true} muted></video>
      </div>
    </div>
  )
}

export default HappyBirthdayTheme
